import './style.css';
import React from 'react'
import { Link } from "react-router-dom";

function telaInicial(){
      
    return(
            <div className="fundo">
            <p>TESTE</p>
            <Link to="/logar"></Link>
            <input type='text'></input>
            </div>
    );
}

export default telaInicial;
